import { Card, ListGroup } from "react-bootstrap";
import SubSidebar from "./SubSidebar";
import User from "./User";
function Sidebar() {
  return (
    <Card
      style={{
        width: "18rem",
        float: "left",
        backgroundColor: "gray",
        width: "300px",
        height: "90vh",
        margin: "10px",
      }}
      className="Sidebar"
    >
      <Card.Header>
        <User
          src={"./img/icons/credit-card.svg"}
          name={"Hozifa Siddig Mohammed"}
        />
      </Card.Header>
      <Card.Title className="title">
        <User
          src={"./img/icons/credit-card.svg"}
          name={"Hozifa Siddig Mohammed"}
        />
      </Card.Title>
      <hr />
      <SubSidebar src="./img/icons/credit-card.svg" name="Payment" />
    </Card>
  );
}

export default Sidebar;
